ر','Image of a book'=>'تصویر یک کتاب','Pattern titleCover with big heading'=>'کاور با تیتر بزرگ','Pattern titleComing soon'=>'به زودی','Pattern descriptionA full-width cover banner that can be applied to a page or it can work as a single landing page.'=>'یک بنر کاور تمام‌عرض که می‌تواند به یک برگه اعمال شود یا به عنوان یک برگهٔ فرود مستقل عمل کند.','Pattern placeholder text.This exquisite compilation showcases a diverse array of photographs that capture the essence of different eras and cultures, reflecting the unique styles and perspectives of each artist. Fleckenstein’s evocative imagery, Strand’s groundbreaking modernist approach, and Kōno’s meticulous documentation of Japanese life come together in a harmonious blend that celebrates the art of photography. Each image in “The Stories Book” is accompanied by insightful commentary, providing historical context and revealing the stories behind the photographs. This collection is not only a visual feast but also a tribute to the power of photography to preserve and narrate the multifaceted experiences of humanity.'=>'این مجموعه نفیس طیف وسیعی از عکاس‌ها را به نمایش می‌گذارد که جوهره دوران‌ها و فرهنگ‌های مختلف را به تصویر کشیده و سبک‌ها و دیدگاه‌های منحصر به فرد هر هنرمند را بازتاب می‌دهد. تصاویری تاثیرگذار از فِلِکِن‌اشتاین، رویکرد نوآورانه مدرن از استرند، و مستندسازی دقیق زندگی ژاپنی توسط کونو در یک ترکیب هماهنگ به هم پیوسته‌اند تا هنر عکاسی را تجلیل کند. هر تصویر در "کتاب داستان‌ها" با توضیحاتی عمیق همراه است که زمینه تاریخی آن را ارائه کرده و داستان‌های پشت هر عکس را آشکار می‌سازد. این مجموعه نه تنها یک جشن بصری است، بلکه ادای احترامی است به قدرت عکاسی برای حفظ و روایت تجربیات چندوجهی انسان‌ها.','Photo of a field full of flowers, a blue sky and a tree.'=>'عکسی از یک میدان پر از گل، آسمان آبی و یک درخت.','Stories'=>'داستان‌ها','Something great is coming soon'=>'چیزی عالی در راه است','Pattern titleShort heading and paragraph and image on the left'=>'تیتر کوتاه و پاراگراف و تصویر در سمت چپ.','Subscribe to get notified when our website is ready.'=>'مشترک شوید تا از آماده شدن وب سایت ما مطلع شوید.','Pattern descriptionA Intro pattern with Short heading, paragraph and image on the left.'=>'یک الگوی مقدمه با تیتر کوتاه، پاراگراف و تصویر در سمت چپ.','Pattern descriptionA business homepage pattern.'=>'یک الگوی صفحه اصلی کسب‌و‌کار.','Pattern descriptionA full-width cover section with a large background image and an oversized heading.'=>'یک بخش کاور تمام‌عرض با یک تصویر پس‌زمینه بزرگ و یک تیتر بزرگ‌تر.','Pattern titleCV/bio'=>'رزومه/بیوگرافی','Pattern descriptionA pattern for a CV/Bio landing page.'=>'یک الگوی برگهٔ فرود رزومه/بیوگرافی.','Heading for banner pattern.New arrivals'=>'تازه رسیده‌‌ها','Example heading in pattern.Hey,'=>'سلام،','Sample description for banner with flower.Like flowers that bloom in unexpected places, every story unfolds with beauty and resilience, revealing hidden wonders.'=>'مانند گل‌هایی که در مکان‌های غیرمنتظره شکوفا می‌شوند، هر داستان با زیبایی و استقامت باز می‌شود و شگفتی‌های پنهان را آشکار می‌سازد.','Woman on beach, splashing water.'=>'زنی در ساحل، آب می‌پاشد.','Link to a page with information about what the person is working on right now.Now'=>'‫اکنون','Pattern placeholder text.We\'re %s, our mission is to deliver exquisite flower arrangements that not only adorn living spaces but also inspire a deeper appreciation for natural beauty.'=>'ما %s هستیم، ماموریت ما ارائه گل آرایی‌های نفیس است که نه تنها زینت‌بخش فضاهای زندگی‌اند، بلکه الهام‌بخش قدردانی عمیق‌تری از زیبایی طبیعی نیز هستند.','Pattern titleLanding page for book'=>'برگهٔ فرود برای کتاب','Pattern placeholder text.My name is Nora Winslow Keene, and I’m a committed public interest attorney. Living in Denver, Colorado, I’ve spent years championing the rights of underrepresented workers. A graduate of Stanford University, I played a key role in securing critical protections for agricultural laborers, ensuring better wages and access to healthcare. My work has focused on advocating for environmental justice and improving the quality of life for rural communities. Every case I take on is driven by the belief that everyone deserves dignity and fair treatment in the workplace.'=>'نام من نورا وینسلو کین است و من یک وکیل متعهد منافع عمومی هستم. من که در دنور، کلرادو زندگی می‌کنم، سال‌هاست که از حقوق کارگرانی که کمتر از آنها نمایندگی می‌شود دفاع کرده‌ام. من که فارغ التحصیل دانشگاه استنفورد بودم، نقشی کلیدی در تامین حمایت‌های حیاتی برای کارگران کشاورزی، تضمین دستمزدهای بهتر و دسترسی به مراقبت‌های بهداشتی ایفا کردم. کار من بر حمایت از عدالت زیست محیطی و بهبود کیفیت زندگی برای جوامع روستایی متمرکز شده است. هر پرونده‌ای که من به عهده می‌گیرم با این باور است که همه مستحق کرامت و رفتار عادلانه در محل کار هستند.','Pattern descriptionA landing page for the book with a hero section, pre-order links, locations, FAQs and newsletter signup.'=>'یک برگهٔ فرود برای کتاب با یک بخش اصلی، پیوند‌های پیش‌سفارش، مکان‌ها، سوالات متداول و ثبت‌نام برای خبرنامه.','Pattern titlePoster-like section'=>'بخش پوستر مانند','Pattern titleLanding page for event'=>'برگهٔ فرود برای رویداد','Pattern descriptionA section that can be used as a banner or a landing page to announce an event.'=>'یک بخش که می‌تواند به عنوان بنر یا برگهٔ فرود برای اعلام یک رویداد استفاده شود.','Pattern descriptionA landing page for the event with a hero section, description, FAQs and call to action.'=>'یک برگهٔ فرود برای رویداد با یک بخش اصلی، توضیحات، سوالات متداول و دعوت به اقدام.','Pattern titleLanding page for podcast'=>'برگهٔ فرود برای پادکست','Placeholder heading in four languages.“Stories, <span lang="es">historias</span>, <span lang="uk">iсторії</span>, <span lang="el">iστορίες</span>”'=>'“داستان‌ها, <span lang="es">historias</span>, <span lang="uk">iсторії</span>, <span lang="el">iστορίες</span>”','Pattern descriptionA landing page for the podcast with a hero section, description, logos, grid with videos and newsletter signup.'=>'یک برگهٔ فرود برای پادکست با یک بخش اصلی، توضیحات، آرم‌ها، شبکه‌ا