کان‌های غیرمنتظره می‌شکفند، هر داستان با زیبایی و استقامت آشکار می‌شود','This immersive event celebrates the universal human experience through the lenses of history and ancestry, featuring a diverse array of photographers whose works capture the essence of different cultures and historical moments.'=>'این رویداد همه‌جانبه تجربهٔ مشترک انسانی را از دریچهٔ تاریخ و تبارشناسی گرامی می‌دارد و مجموعه‌ای متنوع از عکاسان را به نمایش می‌گذارد که آثارشان جوهرهٔ فرهنگ‌های گوناگون و لحظات تاریخی را به تصویر می‌کشند.','The Stories Book, a fine collection of moments in time featuring photographs from Louis Fleckenstein, Paul Strand and Asahachi Kōno, is available for pre-order'=>'کتاب داستان‌ها، مجموعه‌ای ارزشمند از لحظات جاودانه، شامل عکس‌هایی از لوئیس فلکنشتاین، پل استرند و آساهاتچی کونُو، اکنون برای پیش‌خرید در دسترس است','Event Overview Text.Held over a weekend, the event is structured around a series of exhibitions, workshops, and panel discussions. The exhibitions showcase a curated selection of photographs that tell compelling stories from various corners of the globe, each image accompanied by detailed narratives that provide context and deeper insight into the historical significance of the scenes depicted. These photographs are drawn from the archives of renowned photographers, as well as emerging talents, ensuring a blend of both classical and contemporary perspectives.'=>'این رویداد که در طول یک آخر هفته برگزار می‌شود، حول محور مجموعه‌ای از نمایشگاه‌ها، کارگاه‌ها و بحث‌های گروهی ساختار یافته است. نمایشگاه‌ها مجموعه‌ای منتخب از عکس‌هایی را به نمایش می‌گذارند که داستان‌های تأثیرگذاری از گوشه و کنار جهان روایت می‌کنند. هر تصویر با روایت‌های دقیقی همراه است که زمینه و بینش عمیق‌تری در مورد اهمیت تاریخی صحنه‌های به تصویر کشیده ارائه می‌دهند. این عکس‌ها از آرشیو عکاسان برجسته و همچنین استعدادهای نوظهور انتخاب شده‌اند تا ترکیبی از دیدگاه‌های کلاسیک و معاصر را تضمین کنند.','Podcast descriptionStorytelling, expert analysis, and vivid descriptions. The Stories Podcast brings history to life, making it accessible and engaging for a global audience.'=>'داستان‌سرایی، تحلیل‌های کارشناسی، و توصیفات زنده. پادکست داستان‌ها تاریخ را زنده می‌کند و آن را برای مخاطبان جهانی قابل دسترس و جذاب می‌سازد.','Sample hero paragraphLike flowers that bloom in unexpected places, every story unfolds with beauty and resilience, revealing hidden wonders.'=>'مانند گل‌هایی که در مکان‌های غیرمنتظره می‌شکفند، هر داستان با زیبایی و استقامت آشکار می‌شود و شگفتی‌های پنهان را نمایان می‌کند.','Content of the hero section.A fine collection of moments in time featuring photographs from Louis Fleckenstein, Paul Strand and Asahachi Kōno.'=>'مجموعه‌ای نفیس از لحظاتی در گذر زمان، شامل عکس‌هایی از لویی فکنشتاین، پل استرند و آساهاچی کونو.','Hero - Overlapped book cover pattern subline textA fine collection of moments in time featuring photographs from Louis Fleckenstein, Paul Strand and Asahachi Kōno.'=>'مجموعه‌ای نفیس از لحظاتی در گذر زمان، شامل عکس‌هایی از لویی فکنشتاین، پل استرند و آساهاچی کونو.','Acoma Pueblo, in New Mexico, stands as a testament to the resilience and cultural heritage of the Acoma people'=>'آکوما پوئبلو در نیومکزیکو به عنوان نمادی از استقامت و میراث فرهنگی مردم آکومای شناخته می‌شود.','404 error messageThe page you are looking for doesn\'t exist, or it has been moved. Please try searching using the form below.'=>'برگه‌ای که به دنبال آن هستید وجود ندارد یا منتقل شده است. لطفاً با استفاده از فرم زیر جستجو کنید.','Get access to a curated collection of moments in time featuring photographs from historical relevance.'=>'به مجموعه‌ای انتخاب شده از لحظه‌ها به همراه عکس‌های مرتبط تاریخی دسترسی پیدا کنید.','Pattern descriptionA header with title and text and three columns that show 3 events with their images and titles.'=>'یک سربرگ با عنوان و متن و سه ستون که ۳ رویداد را با تصاویر و عناوین آنها نمایش می‌دهد.','Pattern descriptionRSVP for an upcoming event with a cover image and event details.'=>'پاسخ به دعوت برای یک رویداد آینده با تصویر کاور و جزئیات رویداد.